import React, { useState } from "react";



function Lawyerreg() {


//   const navigate = useNavigate()
  const initialData = {
    uploadfile: null,            
    name: "",
    age: "",
    exp: "",
    details: "",
    location: "",
    ratings: "",
    successcase: "",
    csYear: "",
  };

  const [form, setForm] = useState(initialData);


  const submit = async (e) => {
    e.preventDefault();


     const formData = new FormData();
     formData.append("uploadfile", form.uploadfile); 
     formData.append("brandName", form.name);
     formData.append("productName", form.age);
     formData.append("price", form.exp);
     formData.append("productDetails", form.details);
     formData.append("productColor", form.location);
     formData.append("ratings", form.ratings);
     formData.append("productStock", form.successcase);
     formData.append("productYear", form. csYear);

    console.log("checking formdata: ",formData)
    console.log("checking form",form)


  }   


  const imageUpload = (e) => {
    const file = e.target.files[0]; 
    if (file) {
      setForm({
        ...form,
        uploadfile: file, 
      });
    }
  };



  return (
    <div className='vp-out'>
      <div className='first-vp'>
        <div className='top-hp'>
          <h1>Enter Your Details</h1>
        </div>
      </div>
      <div className='cards'>
        <div className='cover'>
          <div className="uni">
            <form onSubmit={submit}>
              <p>
                <input className="file" type="file" accept="image/*" onChange={imageUpload} />
              </p>
              <p>
                <label>Brand Name</label>
                <input
                  value={form.name}
                  onChange={(e) => setForm({ ...form, name: e.target.value })}
                  required
                />
              </p>
              <p>
                <label>Product Name</label>
                <input
                  value={form.age}
                  onChange={(e) => setForm({ ...form, age: e.target.value })}
                  required
                />
              </p>
              <p>
                <label>Product Price</label>
                <input
                  value={form.exp}
                  onChange={(e) => setForm({ ...form, exp: e.target.value })}
                  required
                />
              </p>
              <p>
                <label>Product Details</label>
                <input
                  value={form.details}
                  onChange={(e) => setForm({ ...form, details: e.target.value })}
                />
              </p>
              <p>
                <label>Product Color</label>
                <input
                  value={form.location}
                  onChange={(e) => setForm({ ...form, location: e.target.value })}
                />
              </p>
              <p>
                <label>Ratings</label>
                <input
                  value={form.ratings}
                  onChange={(e) => setForm({ ...form, ratings: e.target.value })}
                />
              </p>
              <p>
                <label>Available Stock</label>
                <input
                  value={form.successcase}
                  onChange={(e) => setForm({ ...form, successcase: e.target.value })}
                />
              </p>
              <p>
                <label>Product Year</label>
                <input
                  value={form.csYear}
                  onChange={(e) => setForm({ ...form, csYear: e.target.value })}
                />
              </p>
              <button className="btn-h" type="submit">Submit</button>
            </form>
          </div>
        </div>


      </div>
    </div>
  );
}

export default Lawyerreg
